import React, { Component } from 'react'
import {Link} from 'react-router-dom';

export default class CreerEnchere extends Component {

  constructor(props) {
    super(props);

    this.onChangeEtat = this.onChangeEtat.bind(this);
    this.onChangeNom = this.onChangeNom.bind(this);
    this.onChangeCategorie = this.onChangeCategorie.bind(this);
    this.onChangePrix = this.onChangePrix.bind(this);
    this.onChangeContact = this.onChangeContact.bind(this);
    this.onChangeInfo = this.onChangeInfo.bind(this);
    this.onChangeImg = this.onChangeImg.bind(this);
   

    this.state = {
     
      etat: '',
      nom: '',
      categorie:'',
      prix:'',
      contact:'',
      info:'',
      img:''
    };
  }

  onChangeEtat(e){
    this.setState({
      etat: e.target.value
    });
  }

  onChangeNom(e){
    this.setState({
      nom: e.target.value
    });
  }

  onChangeCategorie(e){
    this.setState({
      categorie: e.target.value
    });
  }

  onChangePrix(e){
    this.setState({
      prix: e.target.value
    });
  }

  onChangeContact(e){
    this.setState({
      contact: e.target.value
    });
  }

  onChangeInfo(e){
    this.setState({
      info: e.target.value
    });
  }

  onChangeImg(e){
    this.setState({
      img: e.target.value
    });
  }

  onSubmit(e){
    e.preventDefault();

  console.log(`Form submitted:`);
  console.log(`Etat: ${this.state.etat}`);
  console.log(`Nom: ${this.state.nom}`);
  console.log(`Categorie: ${this.state.categorie}`);
  console.log(`Prix: ${this.state.prix}`);
  console.log(`Contact: ${this.state.contact}`);
  console.log(`Info: ${this.state.info}`);
  console.log(`Img: ${this.state.img}`);

  this.setState({
    etat: '',
    nom: '',
    categorie:'',
    prix:'',
    contact:'',
    info:'',
    img:''
  })

  }


  render() {
    return (
      
      <div style={{marginTop: 20}}>
      <h3>Create New Todo</h3>
      <form onSubmit={this.onSubmit}>
          <div className="form-group">
              <label>Description: </label>
              <input  type="text"
                      className="form-control"
                      value={this.state.todo_description}
                      onChange={this.onChangeTodoDescription}
                      />
          </div>
          <div className="form-group">
              <label>Responsible: </label>
              <input  type="text"
                      className="form-control"
                      value={this.state.todo_responsible}
                      onChange={this.onChangeTodoResponsible}
                      />
          </div>
          <div className="form-group">
              <div className="form-check form-check-inline">
                  <input  className="form-check-input"
                          type="radio"
                          name="priorityOptions"
                          id="priorityLow"
                          value="Low"
                          checked={this.state.todo_priority==='Low'}
                          onChange={this.onChangeTodoPriority}
                          />
                  <label className="form-check-label">Low</label>
              </div>
              <div className="form-check form-check-inline">
                  <input  className="form-check-input"
                          type="radio"
                          name="priorityOptions"
                          id="priorityMedium"
                          value="Medium"
                          checked={this.state.todo_priority==='Medium'}
                          onChange={this.onChangeTodoPriority}
                          />
                  <label className="form-check-label">Medium</label>
              </div>
              <div className="form-check form-check-inline">
                  <input  className="form-check-input"
                          type="radio"
                          name="priorityOptions"
                          id="priorityHigh"
                          value="High"
                          checked={this.state.todo_priority==='High'}
                          onChange={this.onChangeTodoPriority}
                          />
                  <label className="form-check-label">High</label>
              </div>
          </div>
          <div className="form-group">
              <input type="submit" value="Create Todo" className="btn btn-primary" />
          </div>
      </form>
  </div>
                
            )
          }}
